import React, { Component } from 'react';
import {
  Button,
  Card,
  CardBody,
  CardFooter,
  CardHeader,
  Col,
  Form,
  FormGroup,
  FormText,
  Input,
  Label,
  Row,
} from 'reactstrap';
import DatePicker from "react-datepicker";


class Fdates extends Component {

    constructor(props) {
        super(props);
        this.state = {
          startDate: new Date(),
          endDate: new Date()
        };

        this.handleStartChange = date => {
          this.setState({
            startDate: date,
          });


      }

      this.handleEndChange = date => {
        this.setState({
          endDate: date,
        });
    }
  }
    render() {
        return (

        <div className="animated fadeIn">

                <br />  

                <strong>Get Reports Weekly/ Monthly Wise</strong><br/>
                <hr/>
                <div className="dates">

                <FormGroup row>
                    <Col md="4">
                    <strong><Label htmlFor="email-input">Start Date:</Label></strong>
                    </Col>
                    <Col xs="12" md="8">
                    <Input type="date" id="log-input" name="date-input" placeholder="date" />
                      <FormText className="help-block">Please enter start date</FormText>
                    </Col>
                  </FormGroup>&nbsp;&nbsp;&nbsp;&nbsp;

                  <FormGroup row>
                    <Col md="4">
                    <strong><Label htmlFor="email-input">End Date:</Label></strong>
                    </Col>
                    <Col xs="12" md="8">
                    <Input type="date" id="log-input" name="date-input" placeholder="date" />
                      <FormText className="help-block">Please enter end date</FormText>
                    </Col>
                  </FormGroup>&nbsp;&nbsp;&nbsp;&nbsp;

                  <FormGroup row>
                    <Col md="3">
                      <strong><Label htmlFor="text-input">Enter Percentage:</Label></strong>
                    </Col>
                  <Col xs="12" md="9">
                      <Input type="text" id="fname" name="fname" placeholder="Enter Percentage i.e. 10%" />
                      <FormText color="muted">Get the report of employee less than or equal to Percentage(optional)</FormText>
                    </Col>
                    </FormGroup>



                 </div>
                <hr/>


      </div>

        );
    }
}
export default Fdates;
